// configurações iniciais
const getDataSession = sessionStorage.getItem('clusters');
array = JSON.parse(getDataSession);

const mapbox = document.getElementById('map-box');
mapbox.innerHTML = mostrarMapa(0);

// Configurações padrão
const mock = { 
    chartConfig: {
        type: 'line',
        datasetsConfig: {
            borderWidth: 1,
            tension: 0,
        }
    },
    zoom: {
        yLimiteMax: 10000, // número máximo de dados
        xLimiteMin: new Date(2002, 1, 5), // menor data
    },
    toolTipConfig: {
        arrow: false,
        followCursor: true,
        animation: 'fade',
    }
}


// Aplicação
if (getDataSession !== null && getDataSession !== 'null') { // if para apenas a aplicação rodar se ja existir um dado

    // Mapa

    function criarHeatMap() {
        const pathDasCidades = document.querySelectorAll('.mapaCidade');

        
    }

    function criarMapa () {
    
        const pathDasCidades = document.querySelectorAll('.mapaCidade');
    
        // Ciclo para percorrer todas as cidades e setar a cor no mapa
        for (let i = 0; i < array.length; i++) { 
            for (let j = 0; j < array[i].city.length; j++) {
                for (let k = 0; k < pathDasCidades.length; k++) {
                    if ((array[i].city[j].toLowerCase()) === (pathDasCidades[k].id)){
                        pathDasCidades[k].setAttribute("style", `fill: ${array[i].color}`);
                    }
                }
            }
        }

        criarToolTips();
    
    }

    function criarToolTips() {
        
        for (let i = 0; i < array.length; i++) {
            for (let j = 0; j < array[i].city.length; j++) {

                let id = `#${array[i].city[j]}`;
                let nome = capitalizar(array[i].city[j]);
                let nomeDoDado = array[i].name

                tippy(id, {
                    content: `
                        <div class="tooltip">
                            <h1 class="tooltip__city">${nome}</h1>
                            <p class="tooltip__dataName">${nomeDoDado}</p>
                        </div>
                    `,
                    allowHTML: true,
                    arrow: mock.toolTipConfig.arrow,
                    followCursor: mock.toolTipConfig.followCursor,
                    animation: mock.toolTipConfig.animation,
                });
            }
        }

    }

    function capitalizar(nome) {

        let separador = '-';
        let index = nome.search(separador);

        if (index !== -1) {

            let palavras = nome.split(separador);

            
            for (let i = 0; i < palavras.length; i++) {
                palavras[i] = palavras[i][0].toUpperCase() + palavras[i].substr(1);
            }

            palavras = palavras.join(" ");

            return palavras;

        } else {

            const palavra =  nome[0].toUpperCase() + nome.substring(1);

            return palavra;
        }

    }

    criarMapa();

    // Grafico

    var label = [];
    const datasets = [];

    function getDataSessionChart () {

        label = array[0].label; // setar label

        for (let i = 0; i < array.length; i++) {

            let datasetsOptions = {
                label: array[i].name,
                data: array[i].data,
                borderWidth: mock.chartConfig.datasetsConfig.borderWidth,
                backgroundColor: array[i].color,
                borderColor: array[i].color,
                tension: mock.chartConfig.datasetsConfig.tension,
                pointBorderWidth: 0,
                pointBackgroundColor: "transparent",   
            }

            datasets.push(datasetsOptions);
        }
    }

    getDataSessionChart();


    // Setar max e min input month

    const data = document.getElementById('filterMonth');
    const minData = label[0].substring(0, 7);
    const maxData = label[label.length - 1].substring(0, 7);

    data.setAttribute('min', minData);
    data.setAttribute('max', maxData);

    // Grafico declarações
    const ctx = document.getElementById('myChart');

    const options = {
        responsive: true,
        aspectRatio: 2,
        plugins: {
            zoom: {
                zoom: {
                    wheel: {
                        enabled: true,
                    },
                    pinch: {
                        enabled: true,
                    },
                    drag: {
                        enabled: true,
                        modifierKey: 'ctrl',
                    },
                    mode: 'xy',
                },
                pan: {
                    enabled: true,
                    mode: 'xy',
                },
                limits: {
                    x: {min: mock.zoom.xLimiteMin},
                    y: {min: 0, max: mock.zoom.yLimiteMax}
                },
            }
        },
        scales: {
            x: {
                min: label[0],
                max: label[label.length - 1],
                type: 'time',
                ticks: {
                    major: {
                        enabled: true
                    }
                }
            },
            y: {
                max: 10000,
                ticks: {
                    beginAtZero: true
                }
            },
        }
    }

    var myChart = new Chart(ctx, {
        type: mock.chartConfig.type,
        data: {
            labels: label,
            datasets: datasets
        },
        options: options,
    });

    function resetZoomChart() {
        myChart.resetZoom();
    }

    // filtro

    function filterData () {
        const date = document.getElementById('filterMonth');

        const year = date.value.substring(0, 4);
        const month = date.value.substring(5, 7);

        const lastDay = (y, m) => {
            return new Date(y, m, 0).getDate(); // pegar o ultimo dia do mes
        };

        const startDate = `${date.value}-01`; // primeiro dia
        const endDate = `${date.value}-${lastDay(year, month)}`; // ultimo dia

        myChart.config.options.scales.x.min = startDate;
        myChart.config.options.scales.x.max = endDate;
        myChart.update(); 
    }

    function resetFilterData () {
        myChart.config.options.scales.x.min = label[0];
        myChart.config.options.scales.x.max = label[label.length - 1];
        myChart.update();
    }
} else {
    
    // Grafico Mensagem

    const chartbox = document.getElementById('chart-box');

    chartbox.innerHTML = `
    <div class="data-not-found">
        <img class="icon__not-found" src="../assets/sem-dados 2.svg"/>
        <h2 class="title__not-found">Nenhum dado Inserido</h2>
        <p class="text__not-found">Insira dados para plotar o gráfico interativo</p>
        <a class="btn__not-found" href="../pages/config.html">INSERIR DADOS</a>
    </div>
    `;

}

